// Initialize Firebase
const firebaseConfig = {
  apiKey: "AIzaSyA6iMP90Rut3jJN2HQ2YIgDrT-UnkCuGcc",
  authDomain: "ampcx-c65ee.firebaseapp.com",
  projectId: "ampcx-c65ee",
  storageBucket: "ampcx-c65ee.appspot.com",
  messagingSenderId: "415601381670",
  appId: "1:415601381670:web:fcf58a8f913cc9b31831e7",
  measurementId: "G-7TR19C873Z"
};

firebase.initializeApp(firebaseConfig);

// Global variables
var db = firebase.firestore();
var conversations;

// Authentication state change listener
firebase.auth().onAuthStateChanged(function (user) {
  if (user) {
    displayUserGreeting(user);
    fetchAndDisplayConversations(user);
  } else {
    redirectToLoginPage();
  }
});

// Sign Out button click event listener
var signOutBtn = document.getElementById('sign-out-btn');
signOutBtn.addEventListener('click', signOut);

// Functions
function displayUserGreeting(user) {
  var userGreeting = document.getElementById('user-greeting');
  if (userGreeting) {
    userGreeting.innerText = 'Hello, ' + user.displayName;
  }
}

function countChannels(convos) {
  const channelCounts = {};

  convos.forEach((conversation) => {
    const channel = conversation.channel_name;
    channelCounts[channel] = (channelCounts[channel] || 0) + 1;
  });

  return channelCounts;
}

function fetchAndDisplayConversations(user) {
  var company = "boostup";
  var companyLower = company.toLowerCase();
  var convosRef = db.collection('slack_convos').doc(companyLower);
console.log(convosRef)
  convosRef
    .get()
    .then((doc) => {
      if (doc.exists) {
        processConversations(doc.data().conversations);
        displayConversations(conversations);
        displayAnalytics(conversations);
      } else {
        console.log('No such document!');
      }
    })
    .catch((error) => {
      console.log('Error getting document:', error);
    });
}

function processConversations(convos) {
  conversations = convos;
  conversations.forEach((conversation) => {
    conversation.timestamp = conversation.timestamp.toDate();
  });
}

function displayConversations(convos) {
  console.log(convos)
  var convoList = document.getElementById('convo-list');
  $(convoList).DataTable({
    data: convos,
    columns: [
      { title: 'Question', data: 'question' },
      { title: 'Answer', data: 'answer' },
      { title: 'Timestamp', data: 'timestamp' },
      { title: 'Channel', data: 'channel_name' }

    ],
    autoWidth: false
  });
}
function countNonDeflectedQuestions(convos) {
  const nonDeflectedQuestions = {};

  convos.forEach((conversation) => {
    if (conversation.answer.includes('Pulling someone in who might know more')) {
      const question = conversation.question;
      nonDeflectedQuestions[question] = (nonDeflectedQuestions[question] || 0) + 1;
    }
  });

  return nonDeflectedQuestions;
}
function displayNonDeflectedQuestionsChart(nonDeflectedQuestions) {
  // Load the Visualization API and the corechart package.
  google.charts.load('current', { 'packages': ['corechart'] });

  // Set a callback to run when the Google Visualization API is loaded.
  google.charts.setOnLoadCallback(drawChart);

  // Callback that creates and populates a data table,
  // instantiates the pie chart, passes in the data and
  // draws it.
  function drawChart() {
    // Create the data table.
    var data = new google.visualization.DataTable();
    data.addColumn('string', 'Question');
    data.addColumn('number', 'Count');

    const rows = Object.entries(nonDeflectedQuestions).map(([question, count]) => [question, count]);
    data.addRows(rows);

    // Set chart options
    var options = {
      'title': 'Most Common Non-Deflected Questions',
      'width': 400,
      'height': 300
    };

    // Instantiate and draw our chart, passing in some options.
    var chart = new google.visualization.BarChart(document.getElementById('non-deflected-questions-chart'));
    chart.draw(data, options);
  }
}
function displayChannelChart(channelCounts) {
  // Load the Visualization API and the corechart package.
  google.charts.load('current', { 'packages': ['corechart'] });

  // Set a callback to run when the Google Visualization API is loaded.
  google.charts.setOnLoadCallback(drawChart);

  // Callback that creates and populates a data table,
  // instantiates the pie chart, passes in the data and
  // draws it.
  function drawChart() {
    // Create the data table.
    var data = new google.visualization.DataTable();
    data.addColumn('string', 'Channel');
    data.addColumn('number', 'Count');

    const rows = Object.entries(channelCounts).map(([channel, count]) => [channel, count]);
    data.addRows(rows);

    // Set chart options
    var options = {
      'title': 'Messages by Channel',
      'width': 400,
      'height': 300
    };

    // Instantiate and draw our chart, passing in some options.
    var chart = new google.visualization.PieChart(document.getElementById('channel-chart'));
    chart.draw(data, options);
  }
}

function displayAnalytics(convos) {
  console.log("success");

  var deflectedCount = 0;
  var totalCount = 0;

  convos.forEach((conversation) => {
    if (!conversation.answer.includes('Pulling someone in who might know more')) {
      deflectedCount++;
    }
    totalCount++;
  });

  displayDeflectedChart(deflectedCount, totalCount - deflectedCount);
  displayNonDeflectedQuestionsChart(countNonDeflectedQuestions(convos));

  // Add this line to call the new function and display the chart
  displayChannelChart(countChannels(convos));
}

function displayDeflectedChart(deflectedCount, nonDeflectedCount) {
  // Load the Visualization API and the corechart package.
  google.charts.load('current', { 'packages': ['corechart'] });

  // Set a callback to run when the Google Visualization API is loaded.
  google.charts.setOnLoadCallback(drawChart);

  // Callback that creates and populates a data table,
  // instantiates the pie chart, passes in the data and
  // draws it.
  function drawChart() {
    // Create the data table.
    var data = new google.visualization.DataTable();
    data.addColumn('string', 'Question Type');
    data.addColumn('number', 'Count');
    data.addRows([
      ['Deflected Questions', deflectedCount],
      ['Non-Deflected Questions', nonDeflectedCount]
    ]);

    // Set chart options
    var options = {
      'title': 'Deflected vs Non-Deflected Questions',
      'width': 400,
      'height': 300
    };

    // Instantiate and draw our chart, passing in some options.
    var chart = new google.visualization.PieChart(document.getElementById('deflected-chart'));
    chart.draw(data, options);
  }
}


function redirectToLoginPage() {
  window.location.href = '/index.html';
}

function signOut() {
  firebase
    .auth()
    .signOut()
    .then(function () {
      redirectToLoginPage();
    })
    .catch(function (error) {
      console.log('Error signing out:', error);
    });
}

function toggleAnalyticsVisibility() {
  var analyticsDiv = document.getElementById('analytics');
  var tableDiv = document.getElementById('table-container');
  tableDiv.style.display = "none"
  analyticsDiv.style.display = analyticsDiv.style.display === 'none' ? 'grid' : 'none';
}

function toggleTableVisibility() {
  var tableDiv = document.getElementById('table-container');
  var analyticsDiv = document.getElementById('analytics');
  analyticsDiv.style.display = "none"

  tableDiv.style.display = tableDiv.style.display === 'none' ? 'block' : 'none';
}
